import React from "react";
import "./NavBar.css";
import { Logo, Changer } from "../assets";

const NavBar = () => {
  return (
    <>
      <div className="navbar-logo">
        <img src={Logo} alt="" />
      </div>
      <div className="navbar-links"></div>
      <div className="theme-changer">
        <img src={Changer} alt="" />
      </div>
    </>
  );
};

export default NavBar;
